1623183635	node	Bãi Nam	Bãi Nam	viewpoint	0101000020E610000098F67244E3125B4068DCE56C4B1A3040	{"poem": "Sóng vỗ rì rào bãi Nam,\\nCát vàng nắng đổ dịu dàng biển xanh", "title": "Bãi Nam - Thiên đường biển hoang sơ giữa lòng Đà Nẵng", "videos": [{"url": "https://www.youtube.com/watch?v=7kjY8NYRUQE&pp=ygULYsOjaSBuYW0gcnY%3D", "caption": "Khám phá vẻ đẹp hoang sơ của Bãi Nam"}], "wikipedia": "https://dulichsontra.com/bai-nam/", "basic_info": {"address": "Bán đảo Sơn Trà, Đà Nẵng, Việt Nam", "opening_hours": "Cả ngày"}, "description_1": "Bãi Nam nằm ẩn mình giữa những rặng dương xanh mát, là điểm đến lý tưởng cho những ai muốn trốn khỏi sự ồn ào của phố thị. Bãi biển này nổi tiếng với bờ cát trắng mịn, làn nước trong vắt và khung cảnh thiên nhiên hoang sơ, chưa bị tác động nhiều bởi du lịch đại chúng.", "description_2": "Đến với Bãi Nam, du khách sẽ được tận hưởng bầu không khí trong lành cùng tiếng sóng vỗ rì rào. Buổi chiều là thời điểm lý tưởng nhất để ngắm hoàng hôn khi mặt trời dần lặn sau những rặng núi phía xa, tạo nên khung cảnh lãng mạn hiếm có. Xung quanh bãi biển còn có nhiều góc sống ảo đẹp mắt với những tảng đá lớn và cây xanh um tùm.", "short_description": "Bãi Nam là một trong những bãi biển đẹp và hoang sơ nhất tại bán đảo Sơn Trà, nơi lý tưởng để tận hưởng không gian yên tĩnh và ngắm hoàng hôn tuyệt đẹp."}	\N
1758586662	node	Thuỷ Sơn	Thuỷ Sơn	attraction	0101000020E61000003BA759A0DD105B40993AD9171A013040	{"poem": "Non nước hữu tình Thuỷ Sơn,\\nChùa xưa in bóng mây trời thong dong", "title": "Thuỷ Sơn - Viên ngọc quý của Ngũ Hành Sơn", "videos": [{"url": "https://www.youtube.com/watch?v=qyRYYE9apZI&pp=ygUaVGjhu6d5IHPGoW4gxJHDoCBu4bq1bmcgcnY%3D", "caption": "Hành trình khám phá Thuỷ Sơn"}], "wikipedia": "https://vinpearl.com/vi/ngon-thuy-son-ngu-hanh-son-da-nang-kinh-nghiem-kham-pha-chi-tiet", "basic_info": {"address": "Ngũ Hành Sơn, Đà Nẵng, Việt Nam", "opening_hours": "07:00-17:30 hàng ngày"}, "description_1": "Thuỷ Sơn là ngọn núi cao nhất và đẹp nhất trong quần thể Ngũ Hành Sơn, với độ cao 160m so với mực nước biển. Nơi đây không chỉ có cảnh quan thiên nhiên hùng vĩ mà còn lưu giữ nhiều di tích lịch sử, văn hóa có giá trị như chùa Tam Thai, chùa Linh Ứng, hang Hoa Nghiêm...", "description_2": "Leo lên đỉnh Thuỷ Sơn, du khách sẽ được chiêm ngưỡng toàn cảnh thành phố Đà Nẵng, dải cát trắng mịn Non Nước và biển Đông xanh thẳm. Trên đường lên đỉnh, bạn sẽ đi qua nhiều hang động tự nhiên với những nhũ đá hình thù kỳ thú, cùng nhiều ngôi chùa cổ mang đậm nét kiến trúc truyền thống Việt Nam.", "short_description": "Thuỷ Sơn là ngọn núi lớn nhất trong quần thể Ngũ Hành Sơn, nổi tiếng với hệ thống hang động kỳ bí, chùa chiền cổ kính và tầm nhìn toàn cảnh thành phố Đà Nẵng."}	\N
5273999121	node	Cầu Thuận Phước	Cầu Thuận Phước	attraction	0101000020E61000001CA08F8D1B0E5B409F71E14048183040	{"poem": "Cầu vươn xa tới biển ngàn, \\nDây văng lộng lẫy, nối tràn ước mơ.", "title": "Cầu Thuận Phước - Dây văng nối biển khơi", "videos": "https://www.youtube.com/watch?v=avRZ8m_Jx_E", "wikipedia": "https://vi.wikipedia.org/wiki/C%E1%BA%A7u_Thu%E1%BA%ADn_Ph%C6%B0%E1%BB%9Bc", "basic_info": {"address": "Sơn Trà, Đà Nẵng, Việt Nam", "opening_hours": "Cả ngày"}, "description_1": "Với thiết kế dây văng hiện đại, cầu Thuận Phước không chỉ là công trình giao thông quan trọng mà còn là điểm nhấn kiến trúc của Đà Nẵng.", "description_2": "Vào ban đêm, cầu sáng rực với hệ thống đèn chiếu sáng, tạo nên một cảnh tượng huyền ảo bên vịnh Đà Nẵng.", "short_description": "Cầu Thuận Phước là cây cầu dây văng dài nhất Việt Nam, nối liền trung tâm Đà Nẵng với cảng biển Tiên Sa."}	https://schools.360cities.net/image/embed/b0NEmZM5IuPmHGfgH28N_Q
3076962095	node	Bảo tàng Quân khu 5	Bảo tàng Quân khu 5	museum	0101000020E6100000C130AA56F00D5B40B55950734D0C3040	{"poem": "Bảo tàng lưu dấu chiến trường,\\nTự hào lịch sử vẻ vang một thời", "title": "Bảo tàng Quân khu 5 - Nơi lưu giữ lịch sử hào hùng", "videos": [{"url": "https://www.youtube.com/watch?v=teVj5ZV8-rc", "caption": "Tham quan Bảo tàng Quân khu 5"}], "wikipedia": "https://vi.wikipedia.org/wiki/B%E1%BA%A3o_t%C3%A0ng_Qu%C3%A2n_khu_5,_%C4%90%C3%A0_N%E1%BA%B5ng", "basic_info": {"address": "Duy Tân, Hải Châu, Đà Nẵng", "opening_hours": "07:30-11:00 và 13:30-17:00 từ thứ 2 đến thứ 6"}, "description_1": "Bảo tàng Quân khu 5 được thành lập năm 1977, là nơi lưu giữ hơn 15.000 hiện vật, hình ảnh, tài liệu quý giá về hai cuộc kháng chiến chống Pháp và chống Mỹ của quân và dân miền Trung - Tây Nguyên. Các hiện vật được trưng bày theo từng chủ đề, phản ánh chân thực cuộc sống chiến đấu gian khổ nhưng đầy anh dũng của các chiến sĩ.", "description_2": "Bên cạnh các phòng trưng bày trong nhà, bảo tàng còn có khu trưng bày ngoài trời với nhiều vũ khí, khí tài quân sự cỡ lớn như xe tăng, máy bay, pháo... Đặc biệt, bảo tàng còn tái hiện lại một số trận đánh nổi tiếng bằng mô hình và các tác phẩm nghệ thuật, giúp du khách dễ hình dung về lịch sử hào hùng của dân tộc.", "short_description": "Bảo tàng Quân khu 5 là nơi lưu giữ và trưng bày hàng ngàn hiện vật, tư liệu quý giá về truyền thống đấu tranh cách mạng của quân và dân miền Trung - Tây Nguyên."}	\N
4172034499	node	Bãi biển Non Nước	Bãi biển Non Nước	attraction	0101000020E610000026FBE769C0105B401A78A4B041053040	{"poem": "Non Nước hữu tình biển xanh,\\nCát vàng sóng vỗ dịu lành nắng mai", "title": "Bãi biển Non Nước - Thiên đường nghỉ dưỡng bậc nhất Đà Nẵng", "videos": [{"url": "https://www.youtube.com/watch?v=X50vUEqypUY", "caption": "Thư giãn tại bãi biển Non Nước"}], "wikipedia": "https://vi.wikipedia.org/wiki/B%C3%A3i_bi%E1%BB%83n_Non_N%C6%B0%E1%BB%9Bc", "basic_info": {"address": "Ngũ Hành Sơn, Đà Nẵng", "opening_hours": "Cả ngày"}, "description_1": "Nằm dưới chân núi Ngũ Hành Sơn, bãi biển Non Nước là một trong những bãi biển đẹp nhất Đà Nẵng với bờ cát trắng mịn trải dài 5km, làn nước trong xanh và sóng êm. Nơi đây từng được tổ chức du lịch thế giới bình chọn là một trong những bãi biển quyến rũ nhất hành tinh.", "description_2": "Xung quanh bãi biển là hệ thống resort, khách sạn cao cấp cùng nhiều nhà hàng phục vụ hải sản tươi ngon. Du khách có thể tham gia các hoạt động thể thao biển như lướt sóng, chèo thuyền kayak hoặc đơn giản là thư giãn dưới những tán dù xanh mát. Buổi chiều là thời điểm lý tưởng để ngắm hoàng hôn khi mặt trời lặn sau dãy Ngũ Hành Sơn.", "short_description": "Bãi biển Non Nước nổi tiếng với bờ cát trắng mịn trải dài 5km, làn nước trong xanh và cảnh quan thiên nhiên hài hòa với núi Ngũ Hành Sơn hùng vĩ."}	\N
